import React, { useState } from 'react';
import Input from './Input';

const InputExample = () => {
  const [value, setValue] = useState('');

  return (
    <div>
      <input
        type="text"
        value={value}
        onChange={(event) => setValue(event.target.value)}
      />
      <p>{value}</p>
    </div>
  );
};

const Prompt01 = () => {
  return (
    <div>
      <h1>Hello World!</h1>
      <p>Welcome to my page.</p>
      <InputExample/>
      
    </div>

   

  );

  
};

export default Prompt01;
